import React ,{Component} from 'react'

class TodoList extends Component{
    constructor(props){
        super(props);
        this.state={
            inputValue:'hello',
            list:[]
        }
    }




    handle提交(){
        console.log(this)
    }

    handleChange(e){
        console.log(e);
        this.setState(
            {
                inputValue:e.da
            }
        )
    }

    render(){
        return(
            <div>
                <div>
                    <input value={this.state.inputValue}
                    onChange={(e)=>{this.handleChange(e)}}
                    />
                    <button onClick={(e)=>{this.handle提交()}}>提交</button>
                </div>
                <ul>
                    <li>1 </li>
                </ul>

            </div>
        )
    }
}


export default TodoList
